import Service from "../service.js"

export default class extends Service {
  logLevel_info
  attrReader_player

  new() {
    $.player = new Audio()
    $.queue = []
    $.playing = false
    $.speaking = false
    $.busy = false
  }

  playEvery(interval, audio) {
    $.loopHandler = runEvery(interval, () => _doThePlaying(audio))
  }

  play(audio, onEnd) {
    if (!$.player) return
    $.loopHandler?.end()

    _doThePlaying(audio, onEnd)
  }

  async _doThePlaying(audio, onEnd) {
    $.playing = true
    try {
      $.player.onended = null
      $.player.pause()
    } catch(e) { log(`audio play failed ${e}`) }

    $.player.onended = () => {
      $.playing = false
      if (onEnd) onEnd()
    }
    $.player.volume = 1
    $.player.src = audio.length >= 30 ? audio : _files(audio)

    try {
      await $.player.play()
    } catch(e) {
      // one cause of exception is if we pause immediately after calling play
    }
  }

  stop() {
    $.player.pause()
    $.queue = []
    $.playing = false
    $.busy = false
  }

  async speakNow(text, onEnd) {
    const audio = await SpeechService.audioFromOpenAI(text)
    play(audio, onEnd)
  }

  sayNext(words) {
    if (words == undefined) return

    const index = $.queue.length

    $.queue.push({
      index: index,
      words: words,
      audioUrl: null,
      generated: false,
      played: false,
      errored: false,
    })

    void _queueWordsToSay(index)
  }

  async _queueWordsToSay(index) {
    const text = $.queue[index].words
    let audioUrl
    $.busy = true

    for (let i = 1; i <= 3; i++) {
      try {
        // log(`  generating job ${index} attempt ${i} (${text.slice(0, 20)}...)`)
        audioUrl = await SpeechService.audioFromOpenAI(text)
      } catch(error) {
        log(`  error fetching job ${index} attempt ${i}${i == 3 ? ' - giving up' : ''}`)
        await sleep(500)
      }

      if (audioUrl != undefined) break
    }
    if (audioUrl == undefined) $.queue[index].errored = true

    $.queue[index].audioUrl = audioUrl
    $.queue[index].generated = true

    void _speakingLoop('generation')
  }

  async _speakingLoop(trigger) {
    const jobsToPlay = $.queue.filter((job) => !job.spoken)
    // if (trigger) {
    //   log(`speakingLoop with ${jobsToPlay.length} jobs remaining - "${trigger}" finished & speaking = ${$.speaking} & playing = ${$.playing}`)
    //   jobsToPlay.forEach((job) => log(`  job #${job.index}: ${job.generated ? 'generated' : 'not generated'} : ${job.spoken ? 'spoken' : 'not spoken'} : ${job.errored ? 'errored' : 'no error'} : ${job.words}...`))
    // }

    if (jobsToPlay.length > 0) {
      const job = jobsToPlay[0]

      if (job.generated && !$.speaking && job.errored) {
        log(`  speak #${job.index} skipped because of generating error`)
        job.spoken = true
        _speakingLoop('playback')
        return
      } else if (job.generated && !$.speaking && !job.errored) {
        job.spoken = true
        _speakThenLoop(job.index, job.words, job.audioUrl)
        return
      } else {
        await sleep(250)
        _speakingLoop()
        return
      }
    } else if (!$.speaking) _doneSpeaking()
  }

  _speakThenLoop(index, words, audioUrl) {
    // if (_plabackSoundTimeoutHandler) clearTimeout(_plabackSoundTimeoutHandler)

    // _plabackSoundTimeoutHandler = setTimeout(() => {
    //   $.playing = false
    //   log(`  speaking now ${$.playing}`)
    //   log(`  play timed out for #${index}, looping anyway.`)
    //   _speakingLoop('timer')
    // }, 8000) // figure out how to cancel this timeout as soon as speaking starts. Add a callback from background to indicate this

    log(`Speaking: ${words}`)
    $.speaking = true
    play(audioUrl, () => {
      $.speaking = false
      // f (._plabackSoundTimeoutHandler) clearTimeout(._plabackSoundTimeoutHandler)
      // log(`  done #${index} - ${words.slice(0,10)}...`)
      _speakingLoop('playback')
    }, words)
  }

  log_doneSpeaking
  _doneSpeaking() {
    $.playing = false
    $.busy = false
    $.queue = []
  }

  _files(name) {
    return {
      "off": "data:audio/mpeg;base64,",
      "typing1": "data:audio/mpeg;base64,",
      "typing2": "data:audio/mpeg;base64,",
      "typing3": "data:audio/mpeg;base64,",
      "click": "data:audio/mpeg;base64,",
      "pop": "data:audio/mpeg;base64,",
      "clink": "data:audio/mpeg;base64,",
      "jeep": "data:audio/mpeg;base64,",
      "pip": "data:audio/mpeg;base64,",
      "thinking": "data:audio/mpeg;base64,",
      "booting": "data:audio/mpeg;base64,"
    }[name]
  }
}
